urlToImage: "https://images.mktw.net/im-438547/social"


  }];
  console.log(data);

  return (
    <div>
      <h1 className="head__text">News App</h1>
      <div className="all__news">
        {data
          ? data.map((news) => (
              <NewsArticle data={news} key={news.url} />
            ))
          : "Loading"}
      </div>
    </div>
  );
}

